import React from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

function Navbar() {
  return (
    <nav className="navbar">
      <div className="logo">TravelApp</div>
      <ul>
        <li><Link to="/">Inicio</Link></li>
        <li><Link to="/add-travel">Agregar Viaje</Link></li>
        <li><Link to="/add-comment">Agregar Comentario</Link></li>
        <li><Link to="/view-travels">Consultar Viajes</Link></li>
      </ul>
    </nav>
  );
}

export default Navbar;
